import React from "react";
import Layout from "../components/layout";

const Dashboard = () => {
  return (
    <React.Fragment>
      <Layout>
        <h1>Dashboard Page</h1>
      </Layout>
    </React.Fragment>
  );
};

export default Dashboard;
